import { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import '../App.css';

const CarList = () => {
  const [cars, setCars] = useState([]);
  const [brand, setBrand] = useState('');
  const [minPrice, setMinPrice] = useState('');
  const [maxPrice, setMaxPrice] = useState('');
  const [selectedCar, setSelectedCar] = useState(null);

  // Memoize fetchCars using useCallback
  const fetchCars = useCallback(async () => {
    try {
      let url = "http://localhost:5000/api/cars";

      if (brand || minPrice || maxPrice) {
        url += `?brand=${brand}&minPrice=${minPrice}&maxPrice=${maxPrice}`;
      }

      const response = await axios.get(url);
      setCars(response.data);
    } catch (error) {
      console.error("Error fetching cars:", error);
    }
  }, [brand, minPrice, maxPrice]); // Dependencies

  // Fetch cars only once on component mount or when filters change
  useEffect(() => {
    fetchCars();
  }, [fetchCars]);

  const handleCardClick = (car) => {
    setSelectedCar(car);
  };

  return (
    <div className="car-listing-container">
      <div className="car-list-header">
   
      <h2>Browse Luxury Cars</h2>
      <div className="filters">
        <input
          type="text"
          placeholder="Brand"
          value={brand}
          onChange={(e) => setBrand(e.target.value)}
           className="filter-input"
        />
        <input
          type="number"
          placeholder="Min Price"
          value={minPrice}
          onChange={(e) => setMinPrice(e.target.value)}
        />
        <input
          type="number"
          placeholder="Max Price"
          value={maxPrice}
          onChange={(e) => setMaxPrice(e.target.value)}
        />
        <button onClick={fetchCars}>Search</button>
      </div>

      <div className="card-grid">
        {cars.map((car) => (
          <div className="car-card" key={car._id} onClick={() => handleCardClick(car)}>
          <div className="car-card-image-container"> 
            <img
              src={`http://localhost:5000/${car.images[0]}`} 
              alt={`${car.brand} ${car.model}`}
              className="car-card-image-container"
            />
           </div>
            <div className="car-info">
              <h3>{car.brand} {car.model}</h3>
              <p>{car.year}</p>
            </div>
          </div>
        ))}
      </div>

      {selectedCar && (
        <div className="car-details">
          <h2>{selectedCar.brand} {selectedCar.model}</h2>
          <p><strong>Year:</strong> {selectedCar.year}</p>
          <p><strong>Price:</strong> ${selectedCar.price}</p>
          <p><strong>Description:</strong> {selectedCar.description}</p>
          <p><strong>Features:</strong> {selectedCar.features.join(", ")}</p>
          <div className="car-images">
            {selectedCar.images.map((image, index) => (
              <img key={index} src={`http://localhost:5000/${image}`} alt="Car" />
            ))}
          </div>
        </div>
      )}
    
    </div></div>
  );
};

export default CarList;
